import React from "react";
import s from '../styles/pages.module.css'

const Paginado = ({charactersPerPage,dogs,paginado}) =>{


    console.log(dogs)
    console.log(charactersPerPage)
    

    const pageNumbers = [];

    for(let i = 0; i<= Math.ceil(dogs/charactersPerPage);i++){
        pageNumbers.push(i)
    }

    return(
        
            <ul className={s.paginado}>
                {pageNumbers && pageNumbers.map(e =>
                {
                    return(<li className="number" key={e}> 
                    <a onClick={()=> paginado(e)}>{e}</a>

                    </li>)
                })}
            </ul>
        
    )




};

export default Paginado;
